import React from "react"

import * as images from "./images"
import "./Maze.css"


function Maze({ maze }) {
  console.log(maze.tiles)
  return (
    <div className="Maze">
      {maze.tiles.map((row, indexRow) => (
        <div className="Maze-row">
          {row.map((cell, indexCell) => (
            indexRow === 0
            ? <img src={indexCell === 1 ? images.stairsUp : images.wall} alt="" />
            : <img src={cell.passable ? images.floor : images.wall} alt="" />
          ))}
        </div>
      ))}
    </div>
  )
}

export default Maze
